THE ALEX JONES SHOW
2009.04.07 Tuesday

Alex talks with Carol de Delley of the de Delley Foundation for Life, dedicated to enact legislation for the protection of victims against violent crime. Alex also talks with monthly guest Mike Rivero, editor of the popular WRH website and radio talk show host on GCN. Alex wrangles the important news stories of the day and takes your calls.  

HR 1: Show's guest info, news, commentary
HR 2: Covers news, events, politics with Mike Rivero
HR 3: Deconstructing Glen Beck with Rivero, AJ news clip on Obama, C. Delley
HR 4: Carol de Delley, commentary, debunking Glen Beck, caller re: Binghamton shooting



